import React from 'react'
import { useSelector } from 'react-redux'
function EditProFileForm() {

    const user = useSelector(({ user }) => user.currentUser);

    console.log(user);
    return (
        <div>
            <form action="">

                <input
                    type="text"
                    name="name"
                    placeholder={'Name'}

                />

            </form>
        </div>
    )
}

export default EditProFileForm
